import React, { useState, useEffect } from "react";
import "./App.css";

const App = () => {
  <div className="app">
    const [movies, setMovies] = useState([]); useEffect(() =>{" "}
    {fetch("/movies").then((response) =>
      response.json().then((data) => {
        setMovies(data.movies);
      })
    )}
    , []);
  </div>;
};

export default App;
